window.bookSummaryJSON = "<p>What you thought you knew about vampires and werewolves is wrong...so very, very, wrong. </p> <p>A thousand years of effort to keep the Unknown World hidden is unraveling and the Patriarch is tired. He needs to find someone to take over. </p> <p>He finds Bethany Anne. </p> <p>Unknown, untested and untried, she sets out to accomplish the impossible while forging a new future. One that no one knew was in danger. </p> <p>And she does it with an attitude that will make you stand up and cheer! </p> <p>They say a dress can make a women, but in this case, the dress is Death, and <i>Death Becomes Her</i> very well indeed. </p> <p>Please note, there is flagrantly foul language in these novels. The main character does not have a problem with cussing, just uninspired cussing. </p>"; 
